-- ----------------------------
-- Table structure for sysfunction
-- ----------------------------
DROP TABLE IF EXISTS `sysfunction`;
CREATE TABLE `sysfunction` (
  `FUNCTIONID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '功能ID',
  `LOCATION` text COLLATE utf8_bin NOT NULL COMMENT '地址(冗余，与资源表URL一致) 连接',
  `TITLE` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '标题--菜单的中文描述',
  `PARENT` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单的父节点',
  `ORDERNO` smallint(6) NOT NULL COMMENT '在同一级菜单中的序号',
  `TYPE` varchar(1) COLLATE utf8_bin NOT NULL COMMENT '结点类型：菜单节点是0，菜单叶子是1，按钮是2',
  `DESCRIPTION` text COLLATE utf8_bin NOT NULL COMMENT '功能的中文描述',
  `LOG` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '在action中是否记日志，1为记，其它不记',
  `DEVELOPER` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '开发人员',
  `ACTIVE` varchar(3) COLLATE utf8_bin DEFAULT NULL COMMENT '是否有效，0为不可用，1为可用',
  `FUNCTIONDESC` text COLLATE utf8_bin COMMENT '功能描述',
  `AUFLAG` varchar(1) COLLATE utf8_bin DEFAULT '0' COMMENT '自动审核标志，0－不自动审核；1－自动审核',
  `RPFLAG` varchar(2) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '报表标志：0－普通模块；1－普通报表；',
  `UPTYPE` varchar(1) COLLATE utf8_bin DEFAULT '9' COMMENT '模块功能分类',
  `PUBLICFLAG` varchar(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '公共函数标志，1－公共函数；0－非公共函数',
  `PRSOURCE` text COLLATE utf8_bin COMMENT '日志数据源',
  `RBFLAG` varchar(1) COLLATE utf8_bin NOT NULL DEFAULT '1' COMMENT '操作日志回退标志：0－不允许回退，1－允许回退',
  `PARAM1` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '自定义模块参数1',
  `PARAM2` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '自定义模块参数2',
  `SYSID` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT 'SYSID',
  `FIRSTOPEN` varchar(1) COLLATE utf8_bin DEFAULT '0' COMMENT '是否第一次加载就默认打开这个功能1打开，0不打开',
  `FOCANCLOSE` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否第一次加载就以tab页打开，而这个tab页可以关闭1可关闭，0不可关闭',
  `REAUFLAG` varchar(1) COLLATE utf8_bin DEFAULT '0' COMMENT '是否稽核 1是，0否',
  `CREATEDATE` datetime DEFAULT NULL COMMENT '创建时间',
  `OWNER` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `CACHE` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '页面是否缓存',
  `ICONCLS` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '导航栏图标IMG的CLASS',
  `ICONURL` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '导航栏图标的URL路径',
  `BUTTONID` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '按钮ID',
  PRIMARY KEY (`FUNCTIONID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='系统功能表';

-- ----------------------------
-- Records of sysfunction
