DROP TABLE IF EXISTS `systimetask`;
CREATE TABLE `systimetask` (
  `TASKID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '定时任务ID',
  `JOBNAME` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '任务名',
  `JOBGROUP` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '任务组织',
  `DESCRIPTION` varchar(150) COLLATE utf8_bin NOT NULL,
  `CRON` varchar(50) COLLATE utf8_bin NOT NULL COMMENT 'CRON表达式',
  `CLASSNAME` varchar(150) COLLATE utf8_bin NOT NULL COMMENT 'class类的全路径',
  `ACTIVE` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否有效 0无效 1有效',
  `ISSTART` char(1) COLLATE utf8_bin NOT NULL COMMENT '运行状态 0：停止 1：运行 ',
  `CREATEDATE` datetime NOT NULL COMMENT '创建时间',
  `CREATOR` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `UPDATEDATE` datetime DEFAULT NULL COMMENT '修改时间',
  `UPDATOR` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改者',
  PRIMARY KEY (`TASKID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='系统定时任务';

-- ----------------------------
-- Records of systimetask
-- ----------------------------

-- ----------------------------
-- Table structure for sysuser
-- ----------------------------
DROP TABLE IF EXISTS `sysuser`;
CREATE TABLE `sysuser` (
  `USERID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '用户ID',
  `PASSWD` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '密码（MD5加密）',
  `LOGINNAME` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '登录名',
  `DEPT` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '部门',
  `DESCRIPTION` text COLLATE utf8_bin COMMENT '描述',
  `IPLIST` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '符合用户登录的IP集合',
  `CHECKIP` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否检查IP 1是，0否',
  `USEFUL` varchar(1) COLLATE utf8_bin NOT NULL DEFAULT '1' COMMENT '用户是否有效 1有效，0无效',
  `ISLEADER` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否领导 1是，0不是',
  `REGIONID` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '区域代码',
  `USERNAME` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '用户名称',
  `OWNER` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `RATE` varchar(8) COLLATE utf8_bin DEFAULT NULL COMMENT '保留2',
  `CERTIFICATION` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '证件号码',
  `MACADDR` text COLLATE utf8_bin COMMENT '网卡地址',
  `USERTYPE` varchar(2) COLLATE utf8_bin NOT NULL COMMENT '用户类别 0云管理员，1组织管理员，2普通用户',
  `OTHERINFO` text COLLATE utf8_bin COMMENT '其它信息',
  `CREATEDATE` datetime DEFAULT NULL COMMENT '创建时间',
  `HASHCODE` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '散列值',
  `EMAIL` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '电子邮件',
  `PHONE` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '电话号码',
  `ADDRESS` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '联系地址',
  `PSWINVALIDTIME` datetime DEFAULT NULL COMMENT '密码失效时间',
  `ACCTLOCKFLAG` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '账户锁定标志(0:正常 ,1:锁定)',
  PRIMARY KEY (`USERID`),
  KEY `IDX_USER_LOGINNAME` (`LOGINNAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='系统用户表';

-- ----------------------------
-- Records of sysuser
-- ----------------------------

-- ----------------------------
-- Table structure for sysusergroupref
-- ----------------------------
DROP TABLE IF EXISTS `sysusergroupref`;
CREATE TABLE `sysusergroupref` (
  `USERGROUPID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT 'UUID',
  `USERID` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '用户ID',
  `GROUPID` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '组织ID',
  `ISLEADER` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否是组长（1是，0否）',
  PRIMARY KEY (`USERGROUPID`),
  KEY `IDX_SYSUSERGROUPREF_GROUPID` (`GROUPID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户与用户组关联表';

-- ----------------------------
-- Records of sysusergroupref
-- ----------------------------

-- ----------------------------
-- Table structure for sysuserlog
-- ----------------------------
DROP TABLE IF EXISTS `sysuserlog`;
CREATE TABLE `sysuserlog` (
  `OPSENO` bigint(32) unsigned NOT NULL AUTO_INCREMENT COMMENT '业务号::自动产生',
  `FUNCTIONID` varchar(40) COLLATE utf8_bin DEFAULT '' COMMENT '功能编号',
  `YM` int(11) DEFAULT NULL COMMENT '业务年月',
  `OBJECTID` varchar(40) COLLATE utf8_bin DEFAULT NULL COMMENT '对象ID',
  `DIGEST` text COLLATE utf8_bin COMMENT '摘要信息::根据权限管理配置，保存信息',
  `PRCOL1` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要1::预留',
  `PRCOL2` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要2::预留',
  `PRCOL3` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要3::预留',
  `PRCOL4` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要4::预留',
  `PRCOL5` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要5::预留',
  `PRCOL6` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要6::预留',
  `PRCOL7` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要7::预留',
  `PRCOL8` varchar(120) COLLATE utf8_bin DEFAULT NULL COMMENT '摘要8::预留',
  `OPERATOR` varchar(50) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '经办人',
  `OPTIME` datetime NOT NULL COMMENT '经办时间',
  `REMARKS` text COLLATE utf8_bin COMMENT '备注',
  `BZSTATE` varchar(1) COLLATE utf8_bin NOT NULL COMMENT '业务状态::0－正常，1－回退 2－删除',
  `ROLLBACKER` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '回退人',
  `ROLLBACKTIME` datetime DEFAULT NULL COMMENT '回退日期',
  `ORISOURCEB` blob COMMENT '截图界面(压缩后)',
  `FORM` blob COMMENT '数据界面(压缩后)',
  `BROSWER` varchar(120) CHARACTER SET utf8 DEFAULT NULL COMMENT '浏览器版本',
  `OPIP` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '经办者的IP地址',
  `LOGTYPE` int(1) DEFAULT NULL COMMENT '日志类型： 1登录 2退出 3业务',
  PRIMARY KEY (`OPSENO`),
  KEY `IDX_SYSUSERLOG1_FUNCTIONID` (`FUNCTIONID`) USING BTREE,
  KEY `IDX_SYSUSERLOG1_OBJECTID` (`OBJECTID`) USING BTREE,
  KEY `IDX_SYSUSERLOG1_OPTIME` (`OPTIME`) USING BTREE,
  KEY `IDX_SYSUSERLOG1_YM` (`YM`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2086 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='SYSUSERLOG(用户日志表)'
/*!50100 PARTITION BY KEY (OPSENO)
(PARTITION p0 ENGINE = InnoDB,
 PARTITION p1 ENGINE = InnoDB,
 PARTITION p2 ENGINE = InnoDB,
 PARTITION p3 ENGINE = InnoDB,
 PARTITION p4 ENGINE = InnoDB,
 PARTITION p5 ENGINE = InnoDB,
 PARTITION p6 ENGINE = InnoDB,
 PARTITION p7 ENGINE = InnoDB) */;

-- ----------------------------
-- Records of sysuserlog
-- ----------------------------

