-- ----------------------------
-- View structure for authorities
-- ----------------------------
DROP VIEW IF EXISTS `authorities`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `authorities` AS select `sysuser`.`LOGINNAME` AS `username`,`sysuser`.`USEFUL` AS `authority` from `sysuser` where (`sysuser`.`USEFUL` = '1') ; ;

-- ----------------------------
-- View structure for processuser
-- ----------------------------
DROP VIEW IF EXISTS `processuser`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER  VIEW `processuser` AS select `su`.`USERID` AS `user_id`,`su`.`USERNAME` AS `user_name`,`sg`.`GROUPID` AS `group_id`,`sg`.`NAME` AS `group_name`,`sr`.`ROLEID` AS `role_id`,`sr`.`ROLENAME` AS `role_name` from ((((`sysuser` `su` left join `sysusergroupref` `sug` on((`su`.`USERID` = `sug`.`USERID`))) left join `sysgroup` `sg` on((`sug`.`GROUPID` = `sg`.`GROUPID`))) left join `sysact` `sa` on((`sa`.`OBJECTID` = `su`.`USERID`))) left join `sysrole` `sr` on((`sr`.`ROLEID` = `sa`.`ROLEID`))) ;

-- ----------------------------
-- View structure for v_syscode
-- ----------------------------
DROP VIEW IF EXISTS `v_syscode`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_syscode` AS select `syscode`.`CODEID` AS `codeid`,`syscode`.`CODE` AS `code`,`syscode`.`CODEVALUE` AS `codevalue`,`syscode`.`CODEEXPLAIN` AS `codeexplain`,`syscode`.`CODETYPE` AS `codetype`,`syscode`.`CODESTATE` AS `codestate` from `syscode` where (`syscode`.`CODESTATE` = '1') union all select `sysuser`.`USERID` AS `userid`,'USER' AS `USER`,`sysuser`.`LOGINNAME` AS `loginname`,`sysuser`.`USERNAME` AS `username`,`sysuser`.`DESCRIPTION` AS `description`,`sysuser`.`USEFUL` AS `useful` from `sysuser` where (`sysuser`.`USEFUL` = '1') ; ;

